import React from 'react';
import '../Styles/Footer.css';

function Footer() {
  return (
    <footer className="Footer-body">
      <div className="footer-content">
        <p>&copy; 2023 Your Company. All rights reserved.</p>
      </div>
    </footer>
  );
}

export default Footer;
